import React, { Component } from "react";
import { connect } from "react-redux";
import {
  MDBCard,
  MDBCardBody,
  MDBCardImage,
  MDBCardTitle,
  MDBCardText,
  MDBInputGroup,
  MDBRow,
  MDBCol,
  MDBBtn,
  MDBRating,
  MDBIcon,
  MDBInput,
} from "mdbreact";

export class saloncontainer extends Component {
  render() {
    return (
      <div className="bg">
        <MDBRow className="Group_inputsSearchfor_salon">
          <MDBCol md="4">
            {" "}
            <MDBInput noTag type="text" />
            <MDBInput noTag type="text" />{" "}
            <MDBBtn color="blue" size="sm">
              Small button
            </MDBBtn>
          </MDBCol>
        </MDBRow>
      </div>
    );
  }
}

const mapStateToProps = (state) => ({});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(saloncontainer);

